import ReactDOM from 'react-dom';
import './index.css';
import App from './routes/Routes';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
    <React.StrictMode>
        <App/>
    </React.StrictMode>,
    document.getElementById('root') // Todo lo que esté dentro de este nodo va a ser manejado por React DOM
